import React, { Component } from 'react';
import './App.css';
// import Signup from './Signup/Signup';
// import Signin from './Signin/Signin';
// import HeaderHome from '../Header/HeaderHome';
import { BrowserRouter as Router, Link } from "react-router-dom";
import { Jumbotron, Navbar } from 'react-bootstrap';

export default class App extends Component {

  // constructor(props) {

  //   };


  render() {
       return ( 
    <div className="App">
    <Router>
      <Navbar default collapseOnSelect>
        <Link to="/Signup" className="button-signup-home"><button className="signup" href="#">SIGN UP</button></Link>
        <Link to="/Signin" className="button-signin-home"><button className="signin" href="#">SIGN IN</button></Link>
      </Navbar>


        <Jumbotron className="jumbotron-home">
          <h1 className="title-home">Anastasia</h1>
          <p className="first-paragraphe-home">Listen to your music, create your playlists,<br></br>Share them with others.</p>
          <p className="second-paragraphe-home">Anastasia is probably the best streaming music platform, you can subscribe or listen for free.</p>
          <div className="buttons-home">
            <Link to="/about/"><button className="about">ABOUT US</button></Link>
            <Link to="/subscribe/"><button className="subscribe">SUBSCRIBE</button></Link>
          </div>
        </Jumbotron>

      </Router>

         </div>

       )
  };
}
